  \"2016-07-27T22:40:14.238308\",\n\t\"name\": \"daily-movements-habitat-use-and-mortality-factors-of-american-ducks-wintering-in-western-t\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"American black ducks (Anas rubripes) wintering
  in the Mississippi Flyway comprise approx 30% if the continental population. Winter
  surveys for this population have declined by 64& between 1955 and 1985. Information
  similar to that obtained for Atlantic Flyway black ducks is needed for important
  populations of black ducks wintering in interior habitats of the Mississippi Flyway.
  This research project will provide data on daily movements, habitat preferences,
  non-hunting mortality rates and causes of mortality for an important population
  of Mississippi Flyway black ducks.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
